import Footer from "./Footer";
import NavBar from "./NavBar";


const ProfileAdmin = () => {
    return (

        <>
        <NavBar/>
        <div className="profileAdmin">
            This is ADMIN page
        </div>
        <Footer/>
        </>

        
    )
}

export default ProfileAdmin
